import '../App.css';
import React from 'react';

function Section() {
    return (
        <div>
            <section className="container-fluid">
                <a href="baroque2.html" target="_blank">
                    <img src="http://cdn.shopify.com/s/files/1/2277/5269/files/main_slider_desktop_b1347320-3c19-4d8a-8d67-d2141e50958a.jpg?v=1603279033" className="img-fluid w-100 st" />
                </a>
            </section>
            <br />
        </div>
    );
}

export default Section;
